import React from 'react'
import './ExpenseItem.css'
const ExpenseItem = () => {
  return (
    <div className='expense-item'>
        <div>{Date.now()}</div>
        <h2 className='expense-item__description'>car insurance</h2>
        <div>10000</div>  
    </div>
  )
}

export default ExpenseItem
